import React, { useState } from "react";
import './Auth.css'
function Auth(){
    return(
        <div>
           <Login/>
           <Register/>
        </div>
    )
}
const Login=()=>{
   return(
    <div></div>
   )
}

//Register
const Register=()=>{
    const [fname,setFname]=useState("")
    const [lname,setLname]=useState("")
    const [email,setEmail]=useState("")
    const [password,setPassword]=useState("")
    function ufNameHandle(event){
        setFname(event.target.value)
      }
      function ulNameHandle(event){
        setLname(event.target.value)
      }
      function uEmailHandle(event){
        setEmail(event.target.value)
      }
      function upasswordHandle(event){
        setPassword(event.target.value)
      }
    
      function handleSubmit(event){
        
      }
    return(

       <form onSubmit={handleSubmit}>
        <div className="ef border border-primary  rounded">
            <fieldset>
                <legend>Register</legend>

                <div className="input-group pad">
                  <span className="input-group-text">First Name</span>
                  <input type="text" aria-label="First Name"
                  id='fname'
                  value={fname}
                  onChange={ufNameHandle}/>
                </div>


                <div className="input-group pad">
                  <span className="input-group-text">Last Name</span>
                  <input type="text" aria-label="Last Name"
                  id='lname'
                  value={lname}
                  onChange={ulNameHandle}/>
                </div>


                 <div className="input-group pad">
                    <span className="input-group-text">Email</span>
                    <input type="text" aria-label="Email"
                     id='email'
                     value={email}
                     onChange={uEmailHandle}/>
                 </div>

                 <div className="input-group pad">
                    <span className="input-group-text">password</span>
                    <input type="text" aria-label="Password"
                     id='password'
                     value={password}
                     onChange={upasswordHandle}/>
                 </div>


                 <div className="btdiv">
                   <button className="btn btn-primary me-md-2" type="submit">Submit</button>
                 </div>

            </fieldset>
        </div>
        </form>
       )
}
export default Auth;
